import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Layout from '../components/layout';

const Recommendations = () => {
  const navigate = useNavigate();
  const [currentMood, setCurrentMood] = useState(null);
  const [recommendations, setRecommendations] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  const moodRecommendations = {
    Happy: [
      { id: 1, title: "Don't Stop Me Now", artist: "Queen", duration: "3:29" },
      { id: 2, title: "Happy", artist: "Pharrell Williams", duration: "3:53" },
      { id: 3, title: "Walking on Sunshine", artist: "Katrina and the Waves", duration: "3:58" },
      { id: 4, title: "Can't Stop the Feeling!", artist: "Justin Timberlake", duration: "3:56" },
      { id: 5, title: "Good Vibrations", artist: "The Beach Boys", duration: "3:37" }
    ],
    Sad: [
      { id: 6, title: "Someone Like You", artist: "Adele", duration: "4:45" },
      { id: 7, title: "Hurt", artist: "Johnny Cash", duration: "3:38" },
      { id: 8, title: "Everybody Hurts", artist: "R.E.M.", duration: "5:20" },
      { id: 9, title: "The Scientist", artist: "Coldplay", duration: "5:09" },
      { id: 10, title: "Nothing Compares 2 U", artist: "Sinéad O'Connor", duration: "4:40" }
    ],
    Angry: [
      { id: 11, title: "Break Stuff", artist: "Limp Bizkit", duration: "2:46" },
      { id: 12, title: "Killing in the Name", artist: "Rage Against the Machine", duration: "5:13" },
      { id: 13, title: "Given Up", artist: "Linkin Park", duration: "3:09" },
      { id: 14, title: "Bodies", artist: "Drowning Pool", duration: "3:21" },
      { id: 15, title: "Du Hast", artist: "Rammstein", duration: "3:54" }
    ],
    Calm: [
      { id: 16, title: "Weightless", artist: "Marconi Union", duration: "8:59" },
      { id: 17, title: "Clair de Lune", artist: "Claude Debussy", duration: "5:04" },
      { id: 18, title: "Bloom", artist: "The Paper Kites", duration: "3:30" },
      { id: 19, title: "River Flows In You", artist: "Yiruma", duration: "3:10" },
      { id: 20, title: "Spiegel im Spiegel", artist: "Arvo Pärt", duration: "9:24" }
    ],
    Tired: [
      { id: 21, title: "Starboy", artist: "The Weeknd", duration: "3:50" },
      { id: 22, title: "Redbone", artist: "Childish Gambino", duration: "5:27" },
      { id: 23, title: "Location", artist: "Khalid", duration: "3:39" },
      { id: 24, title: "Super Rich Kids", artist: "Frank Ocean", duration: "5:04" },
      { id: 25, title: "Breathe", artist: "Télépopmusik", duration: "4:42" }
    ],
    Energetic: [
      { id: 26, title: "Thunderstruck", artist: "AC/DC", duration: "4:52" },
      { id: 27, title: "Eye of the Tiger", artist: "Survivor", duration: "4:05" },
      { id: 28, title: "Lose Yourself", artist: "Eminem", duration: "5:26" },
      { id: 29, title: "Jump", artist: "Van Halen", duration: "4:01" },
      { id: 30, title: "Titanium", artist: "David Guetta ft. Sia", duration: "4:05" }
    ]
  };

  useEffect(() => {
    const moodData = JSON.parse(localStorage.getItem('selectedMood'));
    if (moodData) {
      setCurrentMood(moodData);
      setTimeout(() => {
        setRecommendations(moodRecommendations[moodData.name] || []);
        setIsLoading(false);
      }, 1500);
    } else {
      navigate('/select-mood');
    }
  }, [navigate]);

  return (
    <Layout 
      title={currentMood ? `${currentMood.name} Recommendations` : "Your Recommendations"}
      showNav={true}
    >
      {currentMood && (
        <div style={localStyles.moodHeader}>
          <div style={{ 
            ...localStyles.moodIndicator,
            backgroundColor: currentMood.color
          }}>
            <span style={localStyles.moodEmoji}>{currentMood.emoji}</span>
            <span style={localStyles.moodName}>{currentMood.name}</span>
          </div>
        </div>
      )}

      {isLoading ? (
        <div style={localStyles.loadingContainer}>
          <div style={localStyles.loadingSpinner}></div>
          <p>Finding perfect songs for you...</p>
        </div>
      ) : (
        <div style={localStyles.recommendations}>
          {recommendations.map(song => (
            <div key={song.id} style={localStyles.songCard}>
              <div style={localStyles.songInfo}>
                <h3 style={localStyles.songTitle}>{song.title}</h3>
                <p style={localStyles.songDetails}>
                  <span style={localStyles.songArtist}>{song.artist}</span>
                  <span style={localStyles.songDuration}>{song.duration}</span>
                </p>
              </div>
              <button style={localStyles.playButton}>
                <span style={localStyles.playIcon}>▶</span> Play
              </button>
            </div>
          ))}
        </div>
      )}
    </Layout>
  );
};

const localStyles = {
  moodHeader: {
    textAlign: 'center',
    marginBottom: '30px',
  },
  moodIndicator: {
    display: 'inline-flex',
    alignItems: 'center',
    padding: '10px 20px',
    borderRadius: '30px',
    marginBottom: '15px',
  },
  moodEmoji: {
    fontSize: '24px',
    marginRight: '10px',
  },
  moodName: {
    color: '#fff',
    fontSize: '18px',
    fontWeight: '600',
  },
  loadingContainer: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '200px',
    color: 'rgba(255, 255, 255, 0.7)',
  },
  loadingSpinner: {
    border: '4px solid rgba(255, 255, 255, 0.1)',
    borderTop: '4px solid #8e44ad',
    borderRadius: '50%',
    width: '40px',
    height: '40px',
    animation: 'spin 1s linear infinite',
    marginBottom: '15px',
  },
  recommendations: {
    display: 'flex',
    flexDirection: 'column',
    gap: '15px',
  },
  songCard: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '15px',
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
    borderRadius: '8px',
    transition: 'all 0.3s',
    ':hover': {
      backgroundColor: 'rgba(255, 255, 255, 0.15)',
      transform: 'translateY(-2px)',
    }
  },
  songInfo: {
    flex: 1,
  },
  songTitle: {
    color: '#fff',
    fontSize: '16px',
    fontWeight: '500',
    margin: '0 0 5px 0',
  },
  songDetails: {
    display: 'flex',
    gap: '15px',
    color: 'rgba(255, 255, 255, 0.7)',
    fontSize: '14px',
    margin: 0,
  },
  songArtist: {
    color: 'rgba(255, 255, 255, 0.7)',
  },
  songDuration: {
    color: 'rgba(255, 255, 255, 0.5)',
  },
  playButton: {
    padding: '8px 20px',
    backgroundColor: '#8e44ad',
    color: 'white',
    border: 'none',
    borderRadius: '20px',
    cursor: 'pointer',
    fontSize: '14px',
    fontWeight: '500',
    display: 'flex',
    alignItems: 'center',
    gap: '5px',
    transition: 'all 0.3s',
    ':hover': {
      backgroundColor: '#9b59b6',
      transform: 'scale(1.05)',
    }
  },
  playIcon: {
    fontSize: '12px',
  }
};

export default Recommendations;
